import './App.css';
import {Switch,Route} from 'react-router-dom';
import PokemonList from './container/PokemonList';

function App() {
  return (
    <div>
      <Switch>
        <Route path={"/"} exact component={PokemonList}/>
      </Switch>
    </div>
  );
}

export default App;
